import React from "react";
import {
  LockOutlined,
  UserOutlined,
  MailOutlined,
  PhoneOutlined,
} from "@ant-design/icons";
import { Button, Checkbox, Form, Input } from "antd";
import { Link } from "react-router-dom";
import Swal from "sweetalert2";
import "./Register.css";

const Register = () => {
  const onFinish = (values) => {
    console.log("Received values of form: ", values);
    let pass = values.password;
    let rePass = values.repassword;
    if (pass !== rePass) {
      Swal.fire({
        icon: "error",
        title: "Oops...",
        text: "password does not match!",
      });
    } else if (values) {
      Swal.fire("Good job!", "Sign Up Success!", "success");
    }
  };
  return (
    <>
      <div className='nabar'>
        <img
          src='https://tuyendung.rikkeisoft.com/assets/front/images/logoRikkeisoft.png'
          alt=''
          className='img'
        />
      </div>
      <div className='container'>
        <div className='row'>
          <div className='col-6'>
            <h3 className='title'>
              Welcome to{" "}
              <img
                src='https://tuyendung.rikkeisoft.com/assets/front/images/logoRikkeisoft.png'
                alt=''
                className='img-title'
              />
            </h3>
            <Form
              name='normal_login'
              className='login-form'
              initialValues={{
                remember: true,
              }}
              onFinish={onFinish}
            >
              <Button className='login'>
                <img
                  src='https://www.freepnglogos.com/uploads/google-logo-png/google-logo-png-webinar-optimizing-for-success-google-business-webinar-13.png'
                  alt=''
                  className='logo'
                />
                <b>Đăng nhập bằng Google</b>
              </Button>
              <Form.Item
                name='firtname'
                rules={[
                  {
                    required: true,
                    message: "Please input your FirtName!",
                  },
                ]}
              >
                <Input
                  prefix={<UserOutlined className='site-form-item-icon' />}
                  placeholder='Firt name'
                  className='input-firt'
                />
              </Form.Item>
              <Form.Item
                name='lastname'
                rules={[
                  {
                    required: true,
                    message: "Please input your LastName!",
                  },
                ]}
              >
                <Input
                  prefix={<UserOutlined className='site-form-item-icon' />}
                  placeholder='Last name'
                  className='input-firt'
                />
              </Form.Item>
              <Form.Item>
                <label htmlFor='birthday'>
                  {" "}
                  <b>Birthday : </b>{" "}
                </label>
                <Input type='date' className='birthday' />
              </Form.Item>
              <Form.Item
                name='username'
                rules={[
                  {
                    required: true,
                    message: "Please input your Username!",
                  },
                ]}
              >
                <Input
                  prefix={<UserOutlined className='site-form-item-icon' />}
                  placeholder='Username'
                  className='input'
                />
              </Form.Item>
              <Form.Item
                name='email'
                rules={[
                  {
                    required: true,
                    message: "Please input your Email!",
                  },
                ]}
              >
                <Input
                  prefix={<MailOutlined className='site-form-item-icon' />}
                  type='email'
                  placeholder='Email'
                  className='input'
                />
              </Form.Item>
              <Form.Item
                name='password'
                size='12'
                rules={[
                  {
                    required: true,
                    message: "Please input your Password!",
                  },
                ]}
              >
                <Input
                  prefix={<LockOutlined className='site-form-item-icon' />}
                  type='password'
                  placeholder='Password'
                  className='input'
                />
              </Form.Item>
              <Form.Item
                name='repassword'
                size='12'
                rules={[
                  {
                    required: true,
                    message: "Please input your Password!",
                  },
                ]}
              >
                <Input
                  prefix={<LockOutlined className='site-form-item-icon' />}
                  type='password'
                  placeholder='Re-password'
                  className='input'
                />
              </Form.Item>
              <Form.Item
                name='phone'
                rules={[
                  {
                    required: true,
                    message: "Please input your Phone!",
                  },
                ]}
              >
                <Input
                  prefix={<PhoneOutlined className='site-form-item-icon' />}
                  type='number'
                  placeholder='Phone'
                  className='input'
                />
              </Form.Item>

              <Form.Item>
                <Form.Item name='remember' valuePropName='checked' noStyle>
                  <Checkbox>Remember me</Checkbox>
                </Form.Item>
              </Form.Item>

              <Form.Item>
                <div>
                  <Button
                    type='primary'
                    htmlType='submit'
                    className='login-form-button'
                  >
                    <b>Signup</b>
                  </Button>
                </div>

                <div>
                  <Button className='login'>
                    <img
                      src='https://upload.wikimedia.org/wikipedia/commons/thumb/5/51/Facebook_f_logo_%282019%29.svg/2048px-Facebook_f_logo_%282019%29.svg.png'
                      alt=''
                      className='logo'
                    />
                    <b>Đăng nhập bằng FaceBook</b>
                  </Button>
                </div>
                <div>
                  Already have an account? <Link to='/login'>Login now!</Link>
                </div>
              </Form.Item>
            </Form>
          </div>
          <div className='col-6'>
            <img
              src='https://i.ytimg.com/vi/48ayBkuUrWA/hq720_2.jpg?sqp=-oaymwEYCNAFENAFSFryq4qpAwoIARUAAIhC0AEB&rs=AOn4CLCa71xTdHDO4_6kKkDSjVmERuicqQ'
              alt=''
              className='img-register'
            />
          </div>
        </div>
      </div>
    </>
  );
};
export default Register;
